import './Form.css'


const Form= () => {
    return(
    <form id="form">
        <div className="box">
        <label>UserName</label> <br/>
       <input type="text"/> <br/>
       <label>Age (Years)</label> <br/>
       <input type="number"/>
        </div>
        <div>
            <button id="btn">Add User</button>
        </div>
      
    </form>

    )

     
       

}

export default Form;
